import styles from "./Navbar.module.css";
import logo from "../../Assets/Images/Movies.svg";

const Navbar = (props) => {
  let HtmlNavbar = (
    <div className="h-screen">
      <div
        className={`${styles.navbarContainer} flex justify-between items-center px-20 border-b-2`}
      >
        <img src={logo} alt="Logo" className="h-3/5" />
        <div className="flex">
          <div>
            <p className="text-xl mx-5">Peliculas</p>
          </div>
          <div>
            <p className="text-xl mx-5">Series</p>
          </div>
        </div>
        <div>
          <p>Perfil</p>
        </div>
      </div>
      <div className={styles.contentContainer}>{props.component}</div>
    </div>
  );
  return HtmlNavbar;
};

export default Navbar;
